import React, { useState } from 'react';

function Parent() {
  const [arr, setArr] = useState([]);

  const addItem = () => {
    setArr([...arr], {
      name: 'Tanveer',
      age: Math.floor(Math.random() * 10) + 1,
    });
  };

  return (
    <div>
      <button onClick={addItem}>+</button>
      <p>
        {arr.map((item) => {
          {
            item.name;
          }
        })}
      </p>
    </div>
  );
}

export default Parent;
